import ItemTile from '../components/shop/itemTile.js'
import '../components/shop/shop.css';

export default function Shop() {

  const items = [
      { 'image': 'tshirt.png', 'text': 'blue tshirt', 'price': '£37' },
      { 'image': 'tshirt2.png', 'text': 'red tshirt', 'price': '£36' },
      { 'image': 'tshirt3.png', 'text': 'green tshirt', 'price': '£38' }
    ]

   return (
    <div className="container">
        { 
          items.map( 
            item => (<ItemTile image={item.image} 
                              text={item.text}
                              price={item.price} />)
          )
        }
    </div>
  );
}
